import React from 'react';
import styled from 'styled-components';

const TabsWrapper = styled.div`
  display: flex;
  justify-content: space-around;
  margin-top: 20px;
`;

const Tab = styled.div`
  padding: 10px 20px;
  background: #333;
  border-radius: 5px;
  cursor: pointer;
  color: #fff;
  transition: background 0.3s;

  &:hover {
    background: #444;
  }
`;

const Tabs = ({ onTabChange }) => (
  <TabsWrapper>
    <Tab onClick={() => onTabChange('forYou')}>For You</Tab>
    <Tab onClick={() => onTabChange('topTracks')}>Top Tracks</Tab>
  </TabsWrapper>
);

export default Tabs;
